description:
Tyler ar stjarnan pa dansgolvet pa alla fester som han valdgastar. Men 
resten av hans liv ar inte lika lyckat. Efter att ha begatt ett brott doms 
han till att gora samhallstjanst som vaktmastare pa en ansedd skola som
bland annat utbildar dansare. Nar balettdansosen Nora behover en manlig 
partner till sin show, far hon snart upp ogonen for den rebelliske Tyler.
Med Channing Tatum, Jenna Dewan, Damaine Radcliff, Mario m fl...

